    "2015-03-29T06:43:57.418667",nt"name": "international-macroeconomic-data-set",nt"isopen":
    true,nt"url": null,nt"notes": "The International Macroeconomic Data Set
    provides data from 1969 through 2030 for real (adjusted for inflation) gross domestic
    product (GDP), population, real exchange rates, and other variables for the 190
    countries and 34 regions that are most important for U.S. agricultural trade. The
    data presented here are a key component of the USDA Baseline projections process,
    and can be used as a benchmark for analyzing the impacts of U.S. and global macroeconomic
